function process_order(){var e=document.getElementById("ws_rate"),t=e.options[e.selectedIndex].value,r=document.getElementById("swipbox"),s=document.URL.split("&webshipr_process=true")[0].split("&webshipr_reprocess=true")[0].split("&webshipr_change=true")[0].split("&webshipr_droppoint=true")[0];if(null!==r)var p=r.options[r.selectedIndex].value;null!==r?window.location=s+"&webshipr_process=true&ws_rate="+t+"&swipbox="+p:window.location=s+"&webshipr_process=true&ws_rate="+t}function reprocess_order(){var e=document.getElementById("ws_rate"),t=e.options[e.selectedIndex].value,r=document.URL.split("&webshipr_process=true")[0].split("&webshipr_reprocess=true")[0].split("&webshipr_change=true")[0].split("&webshipr_droppoint=true")[0];window.location=r+"&webshipr_reprocess=true&ws_rate="+t}function change_order(){var e=document.getElementById("ws_rate"),t=e.options[e.selectedIndex].value,r=e.options[e.selectedIndex].text,s=document.URL.split("&webshipr_process=true")[0].split("&webshipr_reprocess=true")[0].split("&webshipr_change=true")[0].split("&webshipr_droppoint=true")[0];window.location=s+"&webshipr_change=true&ws_rate="+t+"&name="+r}function set_droppoint(){var e=document.getElementById("ws_droppoint"),t=e.options[e.selectedIndex].value.split("."),r=document.URL.split("&webshipr_process=true")[0].split("&webshipr_reprocess=true")[0].split("&webshipr_change=true")[0].split("&webshipr_droppoint=true")[0];window.location=r+"&webshipr_droppoint=true&dp_id="+t[0]+"&dp_street="+t[1]+"&dp_zip="+t[2]+"&dp_city="+t[3]+"&dp_name="+t[4]+"&dp_country="+t[5]}